INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 2, 1, 1, 0, 0, 1001, 0, "春咲 ひより", 0, 1, 1.4, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 2, 1, 1, 0, 0, 1002, 0, "草野 優衣", 0, 1, 1.4, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("フェンシングを始めてみては？", "キミに必要な集中力と感性が", 2, 1, 1, 0, 0, 1003, 0, "士条 怜", 0, 1, 1.4, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 2, 1, 1, 0, 0, 1004, 0, "穂高 みそぎ", 0, 1, 1.5, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("風宮あかりです", "ねぇ…", 2, 1, 1, 0, 0, 1006, 0, "風宮 あかり", 0, 1, 1.4, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("出雲宮子なのー", "プリンたべたいのー", 2, 1, 1, 0, 0, 1007, 0, "出雲 宮子", 0, 1, 1.5, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, 1, 0, 0, 1008, 0, "虹村 雪", 0, 1, 1.4, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, 1, 0, 0, 1009, 0, "柊杏奈", 0, 1, 1.4, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, 1, 0, 0, 1010, 0, "姫宮 真歩", 0, 1, 1.5, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, 1, 0, 0, 1011, 0, "衣之咲 璃乃", 0, 1, 1.4, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 2, 1, 1, 0, 0, 1012, 0, "柏崎 初音", 0, 1, 1.4, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 2, 1, 1, 0, 0, 1016, 0, "美波 鈴奈", 0, 1, 1.4, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 2, 1, 1, 0, 0, 1017, 0, "喜屋武 香織", 0, 1, 1.4, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 2, 1, 1, 0, 0, 1018, 0, "支倉 伊緒", 0, 1, 1.4, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, 1, 0, 0, 1020, 0, "茜 ミミ", 0, 1, 1.5, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 2, 1, 1, 0, 0, 1021, 0, "栗林 くるみ", 0, 1, 1.5, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 2, 1, 1, 0, 0, 1022, 0, "風宮 より", 0, 1, 1.4, 0, "なんてありがとうございます！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 2, 1, 1, 0, 0, 1023, 0, "北条 綾音", 0, 1, 1.5, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, 1, 0, 0, 1025, 0, "天野 すずめ", 0, 1, 1.4, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 2, 1, 1, 0, 0, 1027, 0, "倉石 恵理子", 0, 1, 1.4, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, 1, 0, 0, 1028, 0, "佐々木 咲恋", 0, 1, 1.4, 0, "…そうでしょ？？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, 1, 0, 0, 1029, 0, "桜井 望", 0, 1, 1.4, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, 1, 0, 0, 1030, 0, "ニノン・ジュベール", 0, 1, 1.4, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, 1, 0, 0, 1031, 0, "上喜 しのぶ", 0, 1, 1.4, 0, "おかしいですね……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 2, 1, 1, 0, 0, 1033, 0, "野戸まひる", 0, 1, 1.5, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 2, 1, 1, 0, 0, 1034, 0, "綾瀬 ゆかり", 0, 1, 1.4, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("氷川鏡華…です", "知らない人とは話しちゃいけないので", 2, 1, 1, 0, 0, 1036, 0, "氷川 鏡華", 0, 1, 1.5, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("柏崎…栞です。", "……あ、アラーム。", 2, 1, 1, 0, 0, 1038, 0, "柏崎 栞", 0, 1, 1.4, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("ふ、双葉碧です。", "私、一人も友達がいなくて……", 2, 1, 1, 0, 0, 1040, 0, "双葉 碧", 0, 1, 1.4, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, 1, 0, 0, 1042, 0, "三角 千歌", 0, 1, 1.4, 0, "そう思っています。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 2, 1, 1, 0, 0, 1043, 0, "安芸 真琴", 0, 1, 1.4, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 2, 1, 1, 0, 0, 1044, 0, "イリヤ・オーンスタイン", 0, 1, 1.4, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 2, 1, 1, 0, 0, 1045, 0, "遠見 空花", 0, 1, 1.4, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, 1, 0, 0, 1046, 0, "宮坂たまき", 0, 1, 1.4, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("大神美冬よ！", "それでは早速クエストに…", 2, 1, 1, 0, 0, 1048, 0, "大神 美冬", 0, 1, 1.4, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 2, 1, 1, 0, 0, 1049, 0, "星野静流", 0, 1, 1.4, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 2, 1, 1, 0, 0, 1050, 0, "玉泉美咲", 0, 1, 1.5, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("？？？", "？？？？", 2, 1, 1, 0, 0, 1052, 0, "リマ", 0, 1, 1.4, 0, "？？？？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1, 0, 0, 1053, 0, "モニカ・ヴァイスヴィント", 0, 1, 1.5, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1, 0, 0, 1058, 0, "ペコリーヌ", 0, 1, 1.5, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1, 0, 0, 1059, 0, "コッコロ", 0, 1, 1.5, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES ("モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1, 0, 0, 1060, 0, "キャル", 0, 1, 1.5, 0, "そ、そこまでいうなら\nもらってやる");
